- input: "TEXT\x1CC30001010\x1C.TEXT\x1C\x1CF9A\x1CThe first attempt at filing this
    report happened on 9/23/08 - which at the time was within the reporting deadline
    for the Communication Date. The original report was submitted by fax, because
    of problems with the online webform login details. On 10/2 we were contacted by
    Robin Kelly, who said that the file could not be accepted as a fax and that we
    should resubmit it electronically. Since that date, we have been working to resolve
    numerous technical issues, working closely with Ken Lally and Sebene Smith. Those
    issues were resolved today, hence the report being submitted today. A few expenses
    have been incurred since this problem first came to our attention, so those have
    been included also. We hope the FEC will take these circumstances into consideration
    when processing this Form 9. Thank you."
